import React from 'react';
import Sdata from './Sdata';
import Cards from './Cards';

function Netflix(){
    return (
        <Cards 
        key = {Sdata[1].id}
        crdimg = {Sdata[1].simgsrc}
        title= {Sdata[1].stitle}
        category= {Sdata[1].scategory} 
        link= {Sdata[1].slink} 
      />
    )
}

export default Netflix;
